window.bookSummaryJSON = "<p><b>Aleron Kong's number-one best-selling LitRPG saga continues in </b><b><i>The Land: Swarm</i></b><b>.</b></p> <p>The enemies of the Mist Village are moving, the storm clouds are gathering, what are Richter and Sion to do?&nbsp;</p> <p>Crush the game, that's what! More of everything you love in LitRPG: powerful items, epic battles, awesome quests, and in-depth world building!&nbsp;</p> <p>What happened to Elora? Where is the swarm? Did the rock giant make Richter jelly? What are the colonel's secret spices?&nbsp;</p> <p>Journey back into my world and find out! Come back...to the Land!</p>"; 
